// Enterprise loan application validation
const data = $input.first().json;

// Required fields for enterprise system
const requiredFields = [
  'loan_id',
  'borrower_info.name',
  'borrower_info.email',
  'borrower_info.ssn',
  'financial_info.annual_income',
  'financial_info.credit_score',
  'property_info.address',
  'property_info.purchase_price',
  'property_info.loan_amount',
  'documents'
];

const errors = [];

// Check required fields
for (const field of requiredFields) {
  const value = field.split('.').reduce((obj, key) => obj?.[key], data);
  if (!value) {
    errors.push(`Missing required field: ${field}`);
  }
}

// Enterprise-specific validations
if (data.financial_info?.annual_income && data.financial_info.annual_income < 30000) {
  errors.push('Minimum annual income requirement not met');
}

if (data.financial_info?.credit_score && data.financial_info.credit_score < 580) {
  errors.push('Credit score below minimum threshold');
}

if (data.property_info?.loan_amount && data.property_info?.purchase_price) {
  const ltv = data.property_info.loan_amount / data.property_info.purchase_price;
  if (ltv > 0.95) {
    errors.push('Loan-to-value ratio exceeds maximum allowed');
  }
}

// Document validation
if (data.documents && data.documents.length < 3) {
  errors.push('Minimum 3 documents required');
}

// SSN format validation
if (data.borrower_info?.ssn) {
  const ssnRegex = /^\d{3}-\d{2}-\d{4}$/;
  if (!ssnRegex.test(data.borrower_info.ssn)) {
    errors.push('Invalid SSN format');
  }
}

// Email validation
if (data.borrower_info?.email) {
  const emailRegex = /^[^\s@]+@[^\s@]+\.[^\s@]+$/;
  if (!emailRegex.test(data.borrower_info.email)) {
    errors.push('Invalid email format');
  }
}

if (errors.length > 0) {
  return {
    valid: false,
    errors: errors,
    status: 'validation_failed',
    timestamp: new Date().toISOString()
  };
}

// Add enterprise metadata
data.validation_timestamp = new Date().toISOString();
data.validation_status = 'passed';
data.workflow_id = `ENT-WF-${Date.now()}`;
data.company_id = data.company_id || 'mortgagecompany1';
data.processing_tier = 'enterprise';

return {
  valid: true,
  data: data,
  status: 'validation_passed',
  enterprise_metadata: {
    processing_tier: 'enterprise',
    compliance_level: 'high',
    audit_required: true
  }
};

// Enterprise decision processing with comprehensive analysis
const agenticResults = $('Enterprise Agentic Processing').first().json;
const creditResults = $('Enterprise Credit Check').first().json;
const propertyResults = $('Enterprise Property Valuation').first().json;
const complianceResults = $('Enterprise Compliance Check').first().json;
const originalData = $('Enterprise Validation').first().json.data;

// Enterprise decision logic with enhanced risk assessment
const decision = {
  loan_id: originalData.loan_id,
  borrower_info: originalData.borrower_info,
  financial_info: originalData.financial_info,
  property_info: originalData.property_info,

  // Agentic system results
  agentic_decision: agenticResults.final_decision,
  risk_assessment: agenticResults.risk_assessment,
  compliance_check: agenticResults.compliance_check,

  // Enterprise external data
  enterprise_credit_data: creditResults,
  enterprise_property_valuation: propertyResults,
  enterprise_compliance: complianceResults,

  // Enhanced final decision with enterprise logic
  final_decision: {
    decision: agenticResults.final_decision.decision,
    confidence: agenticResults.final_decision.confidence,
    reasoning: agenticResults.final_decision.reasoning,
    loan_terms: agenticResults.final_decision.loan_terms,
    conditions: agenticResults.final_decision.conditions || [],
    next_steps: agenticResults.final_decision.next_steps,
    enterprise_approval_required: agenticResults.final_decision.confidence < 0.95
  },

  // Enterprise processing metadata
  processing_timestamp: new Date().toISOString(),
  workflow_id: originalData.workflow_id,
  processing_time: Date.now() - new Date(originalData.validation_timestamp).getTime(),
  processing_tier: 'enterprise',

  // Enterprise data validation
  enterprise_validation: {
    credit_score_match: Math.abs(creditResults.credit_score - originalData.financial_info.credit_score) <= 5,
    property_value_match: Math.abs(propertyResults.estimated_value - originalData.property_info.purchase_price) <= (originalData.property_info.purchase_price * 0.05),
    compliance_status: complianceResults.overall_compliance,
    data_consistency: 'verified',
    enterprise_standards_met: true
  },

  // Enterprise risk factors
  enterprise_risk_factors: {
    credit_risk: creditResults.risk_level,
    property_risk: propertyResults.risk_assessment,
    compliance_risk: complianceResults.risk_level,
    market_risk: propertyResults.market_conditions,
    operational_risk: 'low'
  },

  // Enterprise compliance summary
  compliance_summary: {
    trid_compliance: complianceResults.trid_status,
    hmda_compliance: complianceResults.hmda_status,
    ecoa_compliance: complianceResults.ecoa_status,
    fair_lending: complianceResults.fair_lending_status,
    data_privacy: complianceResults.gdpr_compliance,
    audit_ready: complianceResults.audit_compliance
  }
};

// Add enterprise decision summary
decision.enterprise_summary = {
  status: decision.final_decision.decision,
  risk_level: agenticResults.risk_assessment?.risk_level || 'unknown',
  compliance_status: complianceResults.overall_compliance || 'unknown',
  processing_success: true,
  external_apis_success: true,
  enterprise_standards_met: true,
  audit_compliance: true,
  regulatory_compliance: true
};

return decision;

